[{"sha":"cae635054e17a6f107a39d328649137b83f25972","author":{"name":"Andrew Clark","email":"46f1a0bd5592a2f9244ca321b129902a06b53e03@andrewclark.io"},"message":"`act`: Resolve to return value of scope function (#21759)

When migrating some internal tests I found it annoying that I couldn't
return anything from the `act` scope. You would have to declare the
variable on the outside then assign to it. But this doesn't play well
with type systems ‚Äî when you use the variable, you have to check
the type.

Before:

```js
let renderer;
act(() => {
  renderer = ReactTestRenderer.create(<App />);
})

// Type system can't tell that renderer is never undefined
renderer?.root.findByType(Component);
```

After:

```js
const renderer = await act(() => {
  return ReactTestRenderer.create(<App />);
})
renderer.root.findByType(Component);
```","distinct":true,"url":"https://api.github.com/repos/MichaelDeBoey/react/commits/cae635054e17a6f107a39d328649137b83f25972"}]

